import React from 'react';
import './CareerHighlights.css';

const CareerHighlights = () => {
    return (
        <section className="career-highlights">
            <h2>Career Highlights</h2>
            <ul>
                <li>Debuted for India in August 2008, against Sri Lanka</li>
                <li>Captained India to Under-19 World Cup victory in 2008</li>
                <li>First Indian to score a century on World Cup debut (2011)</li>
                <li>ICC Cricketer of the Year in 2017 and 2018</li>
                <li>Leading run-scorer in T20 Internationals</li>
                <li>Fastest century in ODIs by an Indian (52 balls against Australia in 2013)</li>
                <li>First player to score 4 double centuries in consecutive Test series</li>
                <li>Scored 973 runs in a single IPL season (2016), the highest ever</li>
                <li>Reached 10,000 ODI runs in just 205 innings, the fastest ever</li>
                <li>Led India to a historic Test series win in Australia (2018-19)</li>
                <li>Scored 76 runs in the 2024 T20 World Cup final, leading India to victory</li>
            </ul>
        </section>
    );
};

export default CareerHighlights;
